/*
	This contains the routes that the router will use, it's in it's own file to keep things tidy with the withRouter
*/
import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import { withRouter } from "react-router";

// The pages components by the router
import Home       from './components/home'
import Details    from './components/details'
import HeaderBar  from './components/header-bar'

const Routes = ({location}) => (
    <Switch>
        <Route exact path='/' component={Home} key={location.pathname}/>
        <Route path='/details/:license/:prettyname' component={Details} key={location.pathname}/>
    </Switch>
);

export default withRouter(Routes)
